(12, 2, 'Angular Framework', 'mudassir', '', '2018-10-13', 'angularjs.jpeg', '<h3>Why AngularJS?</h3><p>HTML is great for declaring static documents, but it falters when we try to use it for declaring dynamic views in web-applications. AngularJS lets you extend HTML vocabulary for your application. The resulting environment is extraordinarily expressive, readable, and quick to develop.</p><h3>Alternatives</h3><p>Other frameworks deal with HTMLs shortcomings by either abstracting away HTML, CSS, and/or JavaScript or by providing an imperative way for manipulating the DOM. Neither of these address the root problem that HTML was not designed for dynamic views.</p><h3>&nbsp;</h3>', 'angular, front-end, framwork', '', 'Activated', 0),
(13, 9, 'React Framework', 'Hamza Mairaj ', '', '2018-10-12', 'ract.png', '<h3>Declarative</h3><p>React makes it painless to create interactive UIs. Design simple views for each state in your application, and React will efficiently update and render just the right components when your data changes.</p><p>Declarative views make your code more predictable and easier to debug.</p><h3>Component-Based</h3><p>Build encapsulated components that manage their own state, then compose them to make complex UIs.</p><p>Since component logic is written in JavaScript instead of templates, you can easily pass rich data through your app and keep state out of the&nbsp;DOM.</p><h3>Learn&nbsp;Once, Write&nbsp;Anywhere</h3><p>We dont make assumptions about the rest of your technology stack, so you can develop new features in React without rewriting existing code.</p><p>React can also render on the server using Node and power mobile apps using <a href=\"https://facebook.github.io/react-native/\">React Native</a>.</p>', 'javascript, react, frontend, framework', '', 'Active', 0),
(15, 2, 'Code Editor', 'Mudassir Imam', '', '2018-10-13', 'Visual-Studio-684x513.jpg', '<p><strong>VS</strong><br><i>Code editor</i></p>', 'code, editor', '', 'Active', 0),
(16, 1, 'Linkedin updates', 'Mudassir Imam', '', '2018-10-17', 'download.jpg', '<h3>Who are we?</h3><p>We are the adldklasjdkas;ld..................................................<br>&nbsp;</p><p><br>&nbsp;</p>', 'linkedin, jobs', '', 'Active', 0),
(17, 9, 'Instagram Updates', 'Abcdef', '', '2018-10-12', 'download (1).jpg', '<p><i><strong>Instagram. </strong></i>&nbsp;<br>(also known as IG) is a photo and video-sharing social networking service owned by Facebook, Inc. It was created by Kevin Systrom and Mike Krieger, and launched in October 2010 exclusively on iOS. ... Users can \"like\" photos, and follow other users to add their content to a feed.</p>', 'social, insta', '', 'Active', 0),
(18, 1, 'New Feature', 'Mudassir Imam', '', '2018-10-17', '416rhOVJs4L._SX342_.jpg', '<p>Not just photo taking. Breathtaking.<br>Whether youre looking for everyday edits or total transformations, our graphic design software offers a complete set of professional photography tools to turn your snapshots into works of art. Adjust, crop, remove objects, retouch, and repair old photos. Play with color, effects, and more to turn the ordinary into something extraordinary.</p><h2>&nbsp;</h2>', 'software, photoshop, image, editor, microsoft', '', 'Active', 0);

